  false,\n\t\"url\": null,\n\t\"notes\": \"<p>Dental health is an important part of
  peoples overall health. States are required to provide dental benefits to children
  covered by Medicaid and the Childrens Health Insurance Program (CHIP), but states
  choose whether to provide dental benefits for adults. See the 2010 Medicaid-CHIP
  Oral Health Services fact sheet for information on childrens access to dental services
  and opportunities and challenges to obtaining care.</p>n\",\n\t\"license_title\":
